import * as React from 'react';

interface Props {
    name: string
}

const myStyle = {
    marginBottom: '50px',
    width: '225px',
    height: '50px',
    display: 'flex',
    justifyContent: 'left',
    alignItems: 'center',
    backgroundColor: '#000',
    color: '#FFF'

}

export const NavBarListElement: React.FC<Props> = ({name}) => {
    return (
        <button style={myStyle}>
            {name}
        </button>
    );
}
